import React from "react";

import NamelistItem from "./NamelistItem";

function Namelist(){
    const name=[{
        name:{
            first:"Ahmed",
            last:"Anwer"
        },
        age:9
    },
    {
        name:{
            first:"Mohamed",
            last:"Anwer"
        },
        age:10
    },
    {
        name:{
            first:"Hello",
            last:"How"
        },
        age:15
    },
    {
        name:{
            first:"Ok",
            last:"How"
        },
        age:11
    }];


    return(
        <div>
            <ul>
                <NamelistItem name={name[0].name}/>
            </ul>
        </div>
    );
}
export default Namelist;
